import React from "react";
import { Link } from "react-router-dom";
import "./Navigation.module.css";

const Navigation = () => {
  return (
    <nav className="nav-wrapper">
      <ul>
        <li>
          <Link to="/Work">
            <p>Beomsoo</p>
          </Link>
        </li>
      </ul>
      <ul className="select-area">
        <li>
          <Link to="/Work">
            <p>Work</p>
          </Link>
        </li>
        <li>
          <Link to="/About">
            <p>About</p>
          </Link>
        </li>

        <li>
          <p>Contact</p>
        </li>
      </ul>
    </nav>
  );
};

export default Navigation;
